import Bar from "../../components/bar";
import Hamburguer from "../../components/hamburguer";
import { MainContainer, Area, Cards } from "./styles.js";
import Card from "../../components/card";

const Dashboard = () => {
  return (
    <>
      <Bar />
      <MainContainer>
        <div className="Container">
          <Hamburguer />
          <Card />
          <Card />
        </div>
      </MainContainer>
    </>
  );
};

export default Dashboard;
